dummyData <- df.InbreedingCoeff.SOR[1,]
dummyData$x <- NaN
dummyData$y <- NaN
p <- ggplot(data=sf.InbreedingCoeff.SOR, aes(x=x, y=y)) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
p1 = p +ggtitle("model PDF") + labs(x="InbreedingCoeff", y="SOR") + geom_tile(aes(fill = lod)) + scale_fill_gradient(high="green", low="red", space="rgb")
p <- qplot(x,y,data=df.InbreedingCoeff.SOR, color=retained, alpha=I(1/7),legend=FALSE) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
q <- geom_point(aes(x=x,y=y,color=retained),data=dummyData, alpha=1.0, na.rm=TRUE)
p2 = p + q + labs(x="InbreedingCoeff", y="SOR") + scale_colour_gradient(name="outcome", high="black", low="red",breaks=c(-1,1),guide="legend",labels=c("filtered","retained"))
p <- qplot(x,y,data=df.InbreedingCoeff.SOR[df.InbreedingCoeff.SOR$training != 0,], color=training, alpha=I(1/7)) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
q <- geom_point(aes(x=x,y=y,color=training),data=dummyData, alpha=1.0, na.rm=TRUE)
p3 = p + q + labs(x="InbreedingCoeff", y="SOR") + scale_colour_gradient(high="green", low="purple",breaks=c(-1,1),guide="legend", labels=c("neg", "pos"))
p <- qplot(x,y,data=df.InbreedingCoeff.SOR, color=novelty, alpha=I(1/7)) +theme(panel.background = element_rect(fill = "white"), panel.grid.minor = element_line(colour = "white"), panel.grid.major = element_line(colour = "white"))
q <- geom_point(aes(x=x,y=y,color=novelty),data=dummyData, alpha=1.0, na.rm=TRUE)
p4 = p + q + labs(x="InbreedingCoeff", y="SOR") + scale_colour_gradient(name="novelty", high="blue", low="red",breaks=c(-1,1),guide="legend", labels=c("novel","known"))
arrange(p1, p2, p3, p4, ncol=2)
dev.off()
if (exists("compactPDF")) {
compactPDF(outputPDF)
